import { FunctionComponent } from "react";
import "./Card.scss";
import styled from "styled-components";

export const Card = styled.div`
display: flex;
flex-direction: column;
align-items: center;
box-shadow: 0 2px 8px $primary-color;
border-radius: 6px;
margin: 10em 3em 5em 3em;
padding: 2.5em;
`;
